import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View, FlatList } from 'react-native';

const exercises = [
  "Упражнение 1",
  "Упражнение 2",
  "Упражнение 3",
  "Упражнение 4",
  "Упражнение 5",
  "Упражнение 6",
  "Упражнение 7",
  "Упражнение 8",
]

function Item({title}) {
  return (
    <Text style={styles.itemText}>{title}</Text>
  )
}

export default function App() {
  return (
    <View style={styles.container}>
      <FlatList 
        data={exercises}
        renderItem={({item, index, separators}) => (
          <Item 
            title={item} 
            key={item}
            style={styles.item}
          />
        )}
      />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff'
  },
  item: {
    paddingTop: 5,
    paddingBottom: 5,
    paddingLeft: 5,
    paddingRight: 5
  },
  itemText: {
    fontSize: 20,
  }
});
